import React from "react";
import "./Footer.css";

export default function Footer() {
  return (
    <footer className="mt-auto py-3 bg-dark text-white footer">
      <div className="container footer-container">Admin Panel for SOIL &copy; 2024</div>
      <div className="container footer-container">Created by: SOIL Team</div>
    </footer>
  );
}
